          Start scrolling to see some magic happen
        </Parallax>
        <Parallax
          data={{
            'data-center-center': 'opacity: 1;',
            'data-bottom-top': 'opacity: 0;'
          }}
        >
          Start scrolling to see some magic happen
        </Parallax>
      </ParallaxProvider>
    );
  }
}
export default Home;
